import React from 'react'; 

class AddResource extends React.Component 
{ 
	render(){ 
		return (
            <div>
                <h1> Add Resource</h1>
                <h3> Enter the details of the project below</h3>
                <table>
                <tr>
                <th><label> Name </label> </th>
                <th><input type="text" id="name"/> </th>
                </tr>
                <tr>
                <th><label> Skills </label></th>
                <th><input type="text" id="skills"/> </th>
                </tr>
                <tr>
                <th><label > Billing </label></th>
                <th><input type="text" id="billing"/> </th>
                </tr>
                </table>
                <button id="AddResource"> Add </button>
            </div>
        );
	} 
} 

export default AddResource;
